INSERT INTO `oj_question_submit` VALUES (187, 25, 1, 'java', 'class Solution {\n    public int reverse(int x) {\n        int rev = 0;\n        while (x != 0) {\n            if (rev < Integer.MIN_VALUE / 10 || rev > Integer.MAX_VALUE / 10) {\n                return 0;\n            }\n            int digit = x % 10;\n            x /= 10;\n            rev = rev * 10 + digit;\n        }\n        return rev;\n    }\n}', '{\"inputList\":[\"123\",\"-123\",\"120\"],\"outputList\":[\"321\",\"-321\",\"21\"],\"message\":\"答案正确\",\"time\":153,\"memory\":10475}', 2, 1, '2024-12-16 01:00:57', '2024-12-16 01:00:59', 0);
