DROP TABLE IF EXISTS `oj_question`;
CREATE TABLE `oj_question`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '题目标题',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '题目内容',
  `main_code` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '主函数代码',
  `question_template` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '题目模板',
  `answer` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '标准答案',
  `answer_code` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '正确代码',
  `submit_num` int NOT NULL DEFAULT 0 COMMENT '题目提交数',
  `difficulty` int NOT NULL COMMENT '难度 1简单 2中等 3困难',
  `accept_num` int NOT NULL DEFAULT 0 COMMENT '题目通过数',
  `judge_config` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '判题配置（json数组）\r\n\r\njson存储类型\r\n[\r\n    {\r\n        input: \'xxx\',  输入用例\r\n        output: \'xxx\'  输出用例\r\n    },\r\n]',
  `judge_case` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '判题用例（json数组）\r\n\r\n[\r\n    {\r\n        timeLimit: \'xxx\',  时间限制\r\n        memoryLimit: \'xxx\'  内存限制\r\n    }\r\n]',
  `user_id` int NOT NULL COMMENT '创建题目用户id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `is_delete` tinyint NOT NULL DEFAULT 0 COMMENT '是否删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 29 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = 'oj模块-题目' ROW_FORMAT = DYNAMIC;

